import React from 'react';
import { createAssistant, createSmartappDebugger } from '@salutejs/client';
import './App.css';

const initializeAssistant = (getState) => {
  if (process.env.NODE_ENV === 'development') {
    return createSmartappDebugger({
      token: process.env.REACT_APP_TOKEN ?? '',
      initPhrase: `Запусти ${process.env.REACT_APP_SMARTAPP}`,
      getState,
      nativePanel: {
        defaultText: 'ччччччч',
        screenshotMode: false,
        tabIndex: -1,
      },
    });
  } else {
    return createAssistant({ getState });
  }
};

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      questions: [
        { id: 1, text: 'Я не чувствую себя расстроенным, печальным.', options: ['Совсем не так', 'Чуть-чуть так', 'Умеренно так', 'Очень так'] },
        { id: 2, text: 'Я расстроен.', options: ['Совсем не так', 'Чуть-чуть так', 'Умеренно так', 'Очень так'] },
        { id: 3, text: 'Я все время расстроен и не могу от этого отключиться.', options: ['Совсем не так', 'Чуть-чуть так', 'Умеренно так', 'Очень так'] },
        { id: 4, text: 'Я настолько расстроен и несчастлив, что не могу это выдержать.', options: ['Совсем не так', 'Чуть-чуть так', 'Умеренно так', 'Очень так'] },
        // Добавьте остальные вопросы здесь
        // Для примера добавлено только 4 вопроса, добавьте остальные вопросы до 21
      ],
      currentQuestionIndex: 0,
      answers: Array(21).fill(null), // Инициализация массива для 21 вопроса
    };

    this.assistant = initializeAssistant(() => this.getStateForAssistant());
    this.assistant.on('data', (event) => {
      const { action } = event;
      this.dispatchAssistantAction(action);
    });
  }

  getStateForAssistant() {
    return {
      item_selector: {
        items: this.state.notes?.map(({ id, title }, index) => ({
          number: index + 1,
          id,
          title,
        })),
        ignored_words: [
          'добавить', 'установить', 'запиши', 'поставь', 'закинь', 'напомнить',
          'удалить', 'удали',
          'выполни', 'выполнил', 'сделал'
        ],
      },
    };
  }

  dispatchAssistantAction(action) {
    if (action) {
      switch (action.type) {
        case 'add_note':
          return this.add_note(action);
        case 'done_note':
          return this.done_note(action);
        case 'delete_note':
          return this.delete_note(action);
        default:
          throw new Error();
      }
    }
  }

  handleOptionChange = (event) => {
    const { value } = event.target;
    const { currentQuestionIndex, answers } = this.state;

    const updatedAnswers = [...answers];
    updatedAnswers[currentQuestionIndex] = value;

    this.setState({ answers: updatedAnswers });
  }

  nextQuestion = () => {
    this.setState(prevState => ({
      currentQuestionIndex: Math.min(prevState.currentQuestionIndex + 1, prevState.questions.length - 1)
    }));
  }

  prevQuestion = () => {
    this.setState(prevState => ({
      currentQuestionIndex: Math.max(prevState.currentQuestionIndex - 1, 0)
    }));
  }

  render() {
    const { questions, currentQuestionIndex, answers } = this.state;
    const currentQuestion = questions[currentQuestionIndex];

    return (
      <div className="container">
        <div className="question-info">
          {questions.map((question, index) => (
            <div key={question.id} className="division-container">
              <div className="question-number">
                {index + 1}
              </div>
              <div className={`division ${index <= currentQuestionIndex ? 'active' : ''}`} />
            </div>
          ))}
        </div>

        <div className="button-container">
          <h2>{currentQuestion.text}</h2>
          {currentQuestion.options.map((option, index) => (
            <div key={index}>
              <input
                type="radio"
                id={`option${index}`}
                name="options"
                value={option}
                checked={answers[currentQuestionIndex] === option}
                onChange={this.handleOptionChange}
                className="radio-button"
              />
              <label htmlFor={`option${index}`} className="label-button">{option}</label>
            </div>
          ))}

          <div className="navigation-button-container">
            <button className="prev-button" onClick={this.prevQuestion} disabled={currentQuestionIndex === 0}>Предыдущий вопрос</button>
            <button className="next-button" onClick={this.nextQuestion} disabled={currentQuestionIndex === questions.length - 1}>Следующий вопрос</button>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
